ss Test: Uses, Procedure, Results - Verywell Health","snippets":["A nuclear stress test is an imaging test that involves an injection of a small amount of radioactive material (tracer) into a vein to create an image of your heart. Also simply known as a stress test, it can show how well your heart is pumping and how well blood is flowing through it while you exercise on a treadmill or stationary bike."],"url":"https://www.verywellhealth.com/nuclear-stress-test-overview-4172096"}]}
