n"},{"index":"11","title":"HIDA Scan: Preparation, Results, Side Effects, and Cost - Healthline","snippets":["A hepatobiliary iminodiacetic acid scan, or HIDA scan, is a diagnostic test used to scan images of organs including the liver, gallbladder, bile ducts, and small intestine."],"url":"https://www.healthline.com/health/hida-scan"}]}
