{"web_search_results":[{"index":"1","title":"Slipped Capital Femoral Epiphysis (SCFE) - Cleveland Clinic","snippets":["Symptoms of slipped capital femoral epiphysis include: Pain in your teen’s groin, knee or hip. Stiffness in your teen’s hip.","Slipped capital femoral epiphysis (SCFE) is a hip disorder. The head of the femur slips off the neck of the bone at the growth plate. Typically, SCFE occurs in overweight children between 11 and 16 years old. Symptoms of SCFE include pain in your teen’s groin, knee or hip; walking with a limp and inability to bear weight on the leg.","Symptoms of slipped capital femoral epiphysis include: Pain in your teen’s groin, knee or hip. Stiffness in your teen’s hip. Foot/leg that is turned outward. Walking with a limp. Can’t put weight on the leg (usually in more severe cases and with extreme pain). One leg may look shorter than the other."],"url":"https://my.clevelandclinic.org/health/diseases/17485-slipped-capital-femoral-epiphysis-scfe"},{"index":"2","title":"Slipped Capital Femoral Epiphysis | Johns Hopkins Medicine","snippets":["What are the signs and symptoms of slipped capital femoral epiphysis? Patients may have pain in the groin, inner thigh, or knee. They may have stiffness and decreased ability to rotate the leg.","What are the signs and symptoms of slipped capital femoral epiphysis? Patients may have pain in the groin, inner thigh, or knee. They may have stiffness and decreased ability to rotate the leg. In addition, there may be a change in their gait, or the way they walk, as they try to put as little weight as possible on the affected side."],"url":"https://www.hopkinsmedicine.org/health/conditions-and-diseases/slipped-capital-femoral-epiphysis"},{"index":"3","title":"Slipped Capital Femoral Epiphysis - StatPearls - NCBI Bookshelf","snippets":["Slipped capital femoral epiphysis (SCFE), also called slipped upper femoral epiphysis (SUFE), is the most common hip pathology in pre-adolescents and adolescents. However, this 